import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Flashcards from '../components/Flashcards'; // Assuming Flashcards component is in the components folder

function Katakana() {
  const [katakana, setKatakana] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/japanese/characters')
      .then(response => {
        setKatakana(response.data.katakana); // Assuming 'hiragana' is the array key
      })
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h1>Katakana Flashcards</h1>
      <Flashcards katakana={katakana} hiragana={[]} />
    </div>
  );
}

export default Katakana;
